description:
Plot: In The Twilight Saga: Breaking Dawn - Part 1, Bella (Kristen Stewart) and Edward (Robert Pattinson), plus those they love, must deal with the chain of consequences brought on by a marriage, honeymoon, and the tumultuous birth of a child... which brings an unforeseen and shocking development for Jacob Black (Taylor Lautner). With more of the romance, passion, intrigue and action that made Twilight, The Twilight Saga: New Moon and The Twilight Saga: Eclipse worldwide blockbusters, The Twilight Saga: Breaking Dawn - Part 1, based on Stephenie Meyer's bestselling book series, begins the conclusion of the tale of vampire love, boundless friendship, acceptance, and finding your true self.



